const successBase64 = "data:audio/mpeg;base64,";

class Sounds {
    /**
     * Plays a success notification sound.
     */
    async success() {
        try {
            const audio = new Audio(successBase64);
            await audio.play();
        } catch (error) {
            console.error("Failed to play sound:", error);
        }
    }
}

export const sounds = new Sounds();
